import React from 'react';
import '../singleproduct.css'

const Singleproduct = () => {
    return (
        <div>
        <div>
  <h2>Single Product Details</h2>
  <div className="container">
    <div className="product-details">
      {/* Product Image */}
      <img src="https://via.placeholder.com/400" alt="Product" className="product-img" />
      {/* Product Details */}
      <div className="product-info">
        <h3>Product Name</h3>
        <p><strong>Price:</strong> Rs. 50</p>
        <p><strong>Description:</strong> This is the product description. It provides details about the product and its features.</p>
        {/* Quantity and Add to Cart */}
        <div className="add-to-cart">
          <label htmlFor="quantity">Quantity:</label>
          <input type="number" id="quantity" name="quantity" min={1} defaultValue={1} className="form-control mb-2" />
          <button className="btn btn-primary">Add to Cart</button>
        </div>
      </div>
    </div>
  </div>
</div>


        </div>
    );
}

export default Singleproduct;
